import React from 'react';
import Modal from 'react-modal';

const Cards = ({modalIsOpen, setModalIsOpen}) => {
    return (
        <Modal 
            ClassName="modal" 
            isOpen={modalIsOpen} 
            onRequestClose={ () => setModalIsOpen(false) }
        >
            <button type="button" class="close" data-dismiss="modal" aria-label="Close" onClick={ () => setModalIsOpen(false) }>
                <span aria-hidden="true">&times;</span>
            </button>
            <h2>Descargar cartones:</h2>
            <a href="/cards/Card01.pdf" download>Cartón 01</a><br/>
            <a href="/cards/Card02.pdf" download>Cartón 02</a><br/>
            <a href="/cards/Card03.pdf" download>Cartón 03</a><br/>
            <a href="/cards/Card04.pdf" download>Cartón 04</a><br/>
            <a href="/cards/Card05.pdf" download>Cartón 05</a><br/>
            <a href="/cards/Card06.pdf" download>Cartón 06</a><br/>
            <a href="/cards/Card07.pdf" download>Cartón 07</a><br/>
            <a href="/cards/Card08.pdf" download>Cartón 08</a><br/>
            <a href="/cards/Card09.pdf" download>Cartón 09</a><br/>
            <a href="/cards/Card10.pdf" download>Cartón 10</a><br/>
        </Modal>
    )
}

export default Cards;
